            <div className="caption text-center">
              {/* <h2>Delivery</h2>
              <p>Entrega em 30 Minutos</p>
              <button className="button">Peca Agora!</button> */}
            </div>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
};

